import { GoogleLogout } from "react-google-login";

const clientId = ""

function Logout() {

  const onSuccess = () => {
    console.log("logout successful");
  }

  return(
    <div id="signOutButton">
      <GoogleLogout
        clientId={clientId}
        buttonText="Logout"
        onLogoutSuccess={onSucess}
      />
    </div>
  )
}

export default Logout;
